class Solution:
    def createSortedArray(self, instructions: List[int]) -> int:
        nums = []
        cost = 0
        n = 0
        prev = None
        lidx = -1
        same = 1
        freq = collections.defaultdict(int)

        for item in instructions:
            freq[item] += 1

            if prev == item:
                cost += min(lidx, n - ridx - same)
                nums.insert(lidx, item)
                n += 1
                same += 1
                continue

            lidx = bisect.bisect_left(nums, item)
            ridx = lidx + freq[item] - 1
            #ridx = bisect.bisect_right(nums, item)

            # [1, 3], 2 -> 1

            # print(nums[:idx], nums[hi_idx:], 'item = ', item, 'hi_idx = ', idx)
            # print(len(nums[:idx]), len(nums[hi_idx:]))
            # print()

            cost += min(lidx, n - ridx)
            nums.insert(lidx, item)
            prev = item
            n += 1
            same = 1

        return cost%(10**9 + 7)


